@airtelindia what a pathetic service  team. I am on call since last 1 hour with your customer service team but no one is yet able to solve the issue.
#boycott #airtelthanks 
@reliancejio

@8b7e447c15f74f5 खुद के संस्कार गन्दे है उस #भ्रष्ट_भास्कर  के मालिक रमेश से क्या उम्मीद कर सकते हैं?
Dainik Bhaskar का boycott करो। उसमें
Jhuth Kaa Bolbala और Sab Golmaal Hai वाली खबरों का वर्चस्व रहता है। https://t.co/RiWLIk7yKm

@PriyaSi75173393 @raghvrai @JantaKeeAwaaz जनता न्यूज पेपर इस लिए पढती है कि सच उन्हें पता चले लेकिन दैनिक भास्कर पेपर ठीक उसका उल्टा करता है झूठी खबर लिखता है ओर जनता को गुमराह करने का काम करता है इसलिए अईसे न्यूज पेपर का बहिष्कार करना चाहिए Boycott Dainik Bhaskar
Jhuth Kaa Bolbala
Sab Golmaal Hai

@_Vaishali_108 सत्य कहा आपने
Dainik Bhaskar एक दिमागी कीड़ा हैं जो निर्दोष को दोषी बताता हैं और दोषी को निर्दोष बताता हैं। इसमें Sab Golmaal Hai , ये हैं #भ्रष्ट_भास्कर के काले कारनामे Jhuth Kaa Bolbala ➿➿➿➿
Boycott Dainik Bhaskar🚫

